contract UsingSettings is IUsingSettings, Owned {
    ISettings Settings;
    modifier __notPaused {
        bool isPaused = Settings.getPaused();
      require(false == isPaused);
      _;
    }

    modifier __onlySystemUser {
        address systemUser = Settings.getSystemUser();
      require(msg.sender == systemUser);
      _;
    }

    function setSettingsContract(address _address) __onlyOwner public {
        Settings = ISettings(_address);
    }
}

