contract Shared is IShared, Owned {

    mapping(address => bool) sharedWith;
    bool linked;
    modifier __onlyShared {
        require(isSharedWith(msg.sender), "Shared: err1");
        _;
    }

    constructor() public {
        sharedWith[msg.sender] = true;
    }

    function setSharingWith(address _address, bool _isShared, bool _linked) __onlyOwner public {
        require(linked == false);
        require(msg.sender != _address, "Shared: err2");

        linked = _linked;
        sharedWith[_address] = _isShared;
    }

    function isSharedWith(address _address) public view returns(bool) {
        return sharedWith[_address];
    }

    //Sadece ilgili contract'a bagli ve degistirilemez.
    function isLinked() public view returns(bool) {
        return linked;
    }

}


contract SharedUint256 is ISharedUint256, Shared {

    mapping(uint256 => mapping(uint256 => uint256)) data;

    function get(uint256 _id) public view returns(uint256) {
        return data[0][_id];
    }

    function set(uint256 _id, uint256 _data) __onlyShared public {
        data[0][_id] = _data;
    }

    function get(uint256 _targetData, uint256 _id) public view returns(uint256) {
        return data[_targetData][_id];
    }

    function set(uint256 _targetData, uint256 _id, uint256 _data) __onlyShared public {
        data[_targetData][_id] = _data;
    }

}

