    }

}


contract SharedArrayUint256 is ISharedArrayUint256, Shared {

    mapping(uint256 => uint256[]) data;

    function get(uint256 _index) public view returns(uint256) {
        return data[0][_index];
    }

    function set(uint256 _index, uint256 _data) __onlyShared public {
        data[0][_index] = _data;
    }

    function get(uint256 _targetData, uint256 _index) public view returns(uint256) {
        return data[_targetData][_index];
    }

    function set(uint256 _targetData, uint256 _index, uint256 _data) __onlyShared public {
        data[_targetData][_index] = _data;
    }

    function push(uint256 _data) __onlyShared public {
        data[0].push(_data);
    }

    function push(uint256 _targetData, uint256 _data) __onlyShared public {
        data[_targetData].push(_data);
    }

    function getLength() public view returns(uint256) {
        return data[0].length;
    }

    function getLength(uint256 _targetData) public view returns(uint256) {
        return data[_targetData].length;
    }

}
